def lib_id2name():
    db = database.connectdb()
    file = "s_5_d_top.txt"
    data = read_json(new_data_dir + "category_data/" + file)
    new_list = []
    for entry in data:
        lib_id = entry
        sql = "SELECT group_str,name_str FROM library WHERE id = " + str(lib_id)
        lib_info = database.querydb(db, sql)
        groupId = lib_info[0][0]
        artifactId = lib_info[0][1]
        new_list.append(groupId + "__fdse__" + artifactId)
    write_json(new_data_dir + "category_data/" + file, new_list)

